export function deleteDuplicats(cart: any) {
  let x: any[] = [];

  let count = cart.filter((data: any) => data.id === cart[cart.length - 1].id);
  let qqq = cart.findIndex(
    (data1: any) => data1.id === cart[cart.length - 1].id
  );

  cart.map((item: any, index: any) => {});

  if (count.length >= 2) {
    cart[qqq].amount = cart[qqq].amount + cart[cart.length - 1].amount;
    cart.pop();
  }
  return x;
}
